/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `after_insert_movimiento` AFTER INSERT ON `movimientos` FOR EACH ROW BEGIN
    DECLARE estado_anterior INT;
    IF NEW.estado = 1 THEN
        INSERT INTO tarjetas(fecha_emision, cliente, estado, pieza, fecha_estado)
        VALUES (NEW.fecha, NEW.tarjeta, 1, NEW.pieza, NEW.fecha);
    ELSEIF NEW.estado =2 THEN
        UPDATE tarjetas 
        SET 
        estado = NEW.estado, 
        fecha_estado = NEW.fecha, 
        ubicacion = NEW.ubicacion,
        cliente = NEW.tarjeta,
        fecha_imposicion = NEW.fecha
        WHERE pieza = NEW.pieza;      
    ELSE
        SELECT estado INTO estado_anterior FROM tarjetas WHERE pieza = NEW.pieza;
        IF estado_anterior = 2 AND (NEW.estado = 3 OR NEW.estado= 7) THEN                    
            UPDATE tarjetas 
            SET 
            estado = NEW.estado, 
            fecha_estado = NEW.fecha, 
            ubicacion = NEW.ubicacion,
            motivo = NEW.motivo,
            fecha_rendicion = NEW.fecha,
            cliente = NEW.tarjeta
            WHERE pieza = NEW.pieza;      
        ELSE
            UPDATE tarjetas 
            SET 
            estado = NEW.estado, 
            fecha_estado = NEW.fecha, 
            ubicacion = NEW.ubicacion,
            motivo = NEW.motivo,
            cliente = NEW.tarjeta
            WHERE pieza = NEW.pieza;
        END IF;
    END IF;
END */;;
