CREATE DEFINER=`root`@`localhost` PROCEDURE `efectiv`(
    IN fecha_inicial DATE,
    IN fecha_final DATE
)
BEGIN
    CREATE TEMPORARY TABLE IF NOT EXISTS temp_efectividad (
        mes VARCHAR(7),
        total_piezas INT,
        entregadas INT,
        devueltas INT,
        porcentaje_entregadas DECIMAL(5,2),
        porcentaje_devueltas DECIMAL(5,2)
    );
    
    INSERT INTO temp_efectividad
    SELECT
        CONCAT(YEAR(fecha), '-', LPAD(MONTH(fecha), 2, '0')) AS mes,    
        COUNT(*) AS total_piezas,
        SUM(CASE WHEN estado = 7 THEN 1 ELSE 0 END) AS entregadas,
        SUM(CASE WHEN estado = 3 THEN 1 ELSE 0 END) AS devueltas,
        ROUND(SUM(CASE WHEN estado = 7 THEN 1 ELSE 0 END) / COUNT(*) * 100, 2) AS porcentaje_entregadas,
        ROUND(SUM(CASE WHEN estado = 3 THEN 1 ELSE 0 END) / COUNT(*) * 100, 2) AS porcentaje_devueltas
    FROM
        movimientos
    WHERE
        estado IN (7, 3)
        AND fecha BETWEEN fecha_inicial AND fecha_final
    GROUP BY
        mes
    ORDER BY
        mes;

    SELECT * FROM temp_efectividad;
    
    DROP TEMPORARY TABLE IF EXISTS temp_efectividad;
END ;;
