        ROUND(SUM(CASE WHEN estado = 3 THEN 1 ELSE 0 END) / COUNT(*) * 100, 2) AS porcentaje_devueltas
    FROM
        movimientos
    WHERE
        estado IN (7, 3)
        AND fecha BETWEEN fecha_inicial AND fecha_final
        AND ubicacion = correo
    GROUP BY
        mes
    ORDER BY
        mes;

    SELECT * FROM temp_efectividad;
    
    DROP TEMPORARY TABLE IF EXISTS temp_efectividad;
END ;;
