CREATE DEFINER=`root`@`localhost` PROCEDURE `rapidez_correo`(
    IN fecha_inicial DATE,
    IN fecha_final DATE,
    IN correo INT
)
BEGIN
    CREATE TEMPORARY TABLE IF NOT EXISTS temp_rapidez (
        mes VARCHAR(7),
        total_piezas INT,        
        rapidez DECIMAL(7,4)        
    );
    
    INSERT INTO temp_rapidez
    SELECT
        CONCAT(YEAR(fecha_imposicion), '-', LPAD(MONTH(fecha_imposicion), 2, '0')) AS mes,    
		COUNT(*) AS total_piezas,
		AVG(datediff(fecha_rendicion, fecha_imposicion)) AS rapidez        
    FROM
        tarjetas        
        inner join movimientos on tarjetas.pieza = movimientos.pieza
    WHERE
        fecha_imposicion IS NOT NULL AND fecha_rendicion IS NOT NULL
        AND fecha_imposicion BETWEEN fecha_inicial AND fecha_final
        AND movimientos.estado = 2
		AND movimientos.ubicacion = correo
    GROUP BY
        mes
    ORDER BY
        mes;

    SELECT * FROM temp_rapidez;
    
    DROP TEMPORARY TABLE IF EXISTS temp_rapidez;
END ;;
